import React from 'react';
import PropTypes from 'prop-types';

import { Panel, PanelHeader, Header, Button, Group, Cell, Div, Avatar } from '@vkontakte/vkui';

const Home = ({ id, go, fetchedUser }) => (
	<Panel id={id}>
		<PanelHeader>Easyntation</PanelHeader>
		{fetchedUser &&
		<Group header={<Header mode="secondary">User Data Fetched with VK Bridge</Header>}>

			<Div>
				<input type="file"/>
			</Div>
		</Group>}

	</Panel>
);

<View activePanel="panel">
	<Panel id="panel">
		<PanelHeader>File</PanelHeader>
		<Group>
			<FormItem top="Загрузите ваше фото">
				<File before={<Icon24Camera role="presentation" />} size="m">
					Открыть галерею
				</File>
			</FormItem>
			<FormItem top="Загрузите документы">
				<File before={<Icon24Document role="presentation" />} size="l" mode="secondary" />
			</FormItem>
		</Group>
	</Panel>
</View>
Home.propTypes = {
	id: PropTypes.string.isRequired,
	go: PropTypes.func.isRequired,
	fetchedUser: PropTypes.shape({
		photo_200: PropTypes.string,
		first_name: PropTypes.string,
		last_name: PropTypes.string,
		city: PropTypes.shape({
			title: PropTypes.string,
		}),
	}),
};

export default Home;
